// src/pages/ProfileOnboarding.js
import React, { useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import axios from "axios";
import "../../styles/ProfileOnboarding.css";

const ProfileOnboarding = () => {
  const { userId } = useParams();
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    hearingStatus: "hearing",
    reasonForLearning: "",
    skillLevel: "",
    phoneNumber: "",
    country: "",
  });
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);

  const handleChange = (e) =>
    setFormData({ ...formData, [e.target.name]: e.target.value });

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    setLoading(true);
    try {
      const token = localStorage.getItem("token"); // if your backend needs a token
      const res = await axios.patch(
        `http://localhost:3006/api/users/profile/${userId}`, // adjust to your endpoint
        formData,
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );
      // res.data = { message, user }
      alert(res.data.message);
      localStorage.setItem("user", JSON.stringify(res.data.user));
      navigate("/profile");
    } catch (err) {
      setError(err.response?.data?.message || "Failed to save profile data");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="onboarding-page">
      <h2>Complete Your Sign Language Profile</h2>
      <p>Weâ€™d love to know more about your sign language journey.</p>

      <form onSubmit={handleSubmit} className="onboarding-form">
        <label htmlFor="hearingStatus">Hearing Status</label>
        <select
          name="hearingStatus"
          id="hearingStatus"
          value={formData.hearingStatus}
          onChange={handleChange}
        >
          <option value="hearing">Hearing</option>
          <option value="hard_of_hearing">Hard of Hearing</option>
          <option value="deaf">Deaf</option>
        </select>

        <label htmlFor="reasonForLearning">Reason for Learning</label>
        <textarea
          id="reasonForLearning"
          name="reasonForLearning"
          placeholder="Why are you learning sign language?"
          value={formData.reasonForLearning}
          onChange={handleChange}
        />

        <label htmlFor="skillLevel">Skill Level</label>
        <select
          name="skillLevel"
          id="skillLevel"
          value={formData.skillLevel}
          onChange={handleChange}
        >
          <option value="">Select your skill level</option>
          <option value="beginner">Beginner</option>
          <option value="intermediate">Intermediate</option>
          <option value="advanced">Advanced</option>
        </select>

        <label htmlFor="phoneNumber">Phone Number</label>
        <input
          type="tel"
          name="phoneNumber"
          id="phoneNumber"
          placeholder="Enter phone number"
          value={formData.phoneNumber}
          onChange={handleChange}
        />

        <label htmlFor="country">Country</label>
        <input
          type="text"
          name="country"
          id="country"
          placeholder="Enter your country"
          value={formData.country}
          onChange={handleChange}
        />

        {error && <p className="error-msg">{error}</p>}

        <button type="submit" className="onboarding-submit-btn" disabled={loading}>
          {loading ? "Saving..." : "Submit"}
        </button>
      </form>
    </div>
  );
};

export default ProfileOnboarding;
